@attr(speed = 'slow' )
class SystemTest( unittest.TestCase ):

    def setUp(self):
        self.s1 = System.from_pdb_string( _string1 )
        self.s2 = System.from_pdb_string( _string2 )
        self.s3 = System.from_pdb_string( _string3 )

    def test_system(self):
        assert len( self.s1 ) == len( self.s2 )
        assert len( self.s1 ) == 6
        assert len( self.s3 ) == 3

        assert self.s2[-1].chain_id == 'X'
        assert self.s2[4][0].res_name == 'MOL'
        assert len( [mol for chain in self.s2 for mol in chain if mol.res_name == 'MOL']) == 5

    def test_atoms(self):
        assert len(self.s1.molecules) == 505

    def test_molecules(self):
        assert len(self.s1.atoms) == 1645

    def test_connections(self):
        s1 = System.from_pdb_string( _string1 )
        s1.connect_everything()
        assert s1[0].System == s1
        assert s1[1].System == s1
        assert s1[2].System == s1
        assert s1[3].System == s1
        assert s1[4].System == s1
        assert s1[5].System == s1

        assert s1[0][0].Cluster == s1[0]
        assert s1[1][0].Cluster == s1[1]
        assert s1[2][0].Cluster == s1[2]
        assert s1[3][0].Cluster == s1[3]
        assert s1[4][0].Cluster == s1[4]
        assert s1[5][333].Cluster == s1[5]
        
    def test_properties(self):
        self.s1.time = '5050'
        self.s1.connect_everything()
        assert isinstance( self.s1[0], Cluster ) 
        assert self.s1[0].time == '5050'

